		hp_warning = "지휘관님……아직은 포기할 때가 아닙니다!",
		upgrade = "오늘 부는 바람은, 평소랑 달리 유난히도 기분 좋네요.",
		voice_key = -1,
		feeling5 = "지휘관님, 오늘 밤은 연회가 끝난 뒤……시간을 내주실 수 있을까요? 우후후, 네, 아무쪼록 기대해주세요♪",
		main = "하아……키리시마가 연회에 참가하기만 하면, 따라온 아이들 때문에 엉망진창이……|싸움에 있어 지혜도 용기만큼 중요합니다. 계책을 버리고 용기에만 기대는 승리는 두 번 다신 없을 거에요.|어떤 상황에서도 지휘관님을 지켜내겠어요. 후후, 그게 가능하니까 '의전함' 인걸요♪",
		voice_key_2 = -1,
		profile = "해가 뜨는 나라에서 건조된 첫 콘고급 전함, 히에이라고 합니다. 의전함으로써 함대를 사열하고, 함대를 이끌어 솔로몬 전투에 참가했었죠. 지휘관님, 준비는 되셨는지요? 연회가 곧 시작된답니다.",
