		feeling4 = "연회에서 모두의 웃는 얼굴을 보고 있으면, 준비하느라 지쳤던 게 싹 가신답니다.",
		unlock = "콘고급 2번함, 의전함 히에이가 도착했습니다. 지휘관님, 다음은 어디로 가시는지요?",
